import React from 'react';
import '../styles/App.css';

const News = () => {
  const instagramPosts = [
    {
      id: 1,
      image: '/images/IMG_0168.PNG',
      link: 'https://www.instagram.com/cakenygardart/'
    },
    {
      id: 2,
      image: '/images/IMG_0169.PNG',
      link: 'https://www.instagram.com/cakenygardart/'
    },
    {
      id: 3,
      image: '/images/IMG_0170.PNG',
      link: 'https://www.instagram.com/cakenygardart/'
    },
    {
      id: 4,
      image: '/images/IMG_0171.PNG',
      link: 'https://www.instagram.com/cakenygardart/'
    },
    {
      id: 5,
      image: '/images/Kidskull3.png',
      link: 'https://www.instagram.com/cakenygardart/'
    },
    {
      id: 6,
      image: '/images/Dogfight2.png',
      link: 'https://www.instagram.com/cakenygardart/'
    }
  ];

  return (
    <main className="news-container">
      <h1>News</h1>

      <div className="instagram-feed">
        <h2>Follow on Instagram</h2>
        <a href="https://www.instagram.com/cakenygardart/" className="instagram-link" target="_blank" rel="noopener noreferrer">@cakenygardart</a>

        <div className="instagram-grid">
          {instagramPosts.map(post => (
            <div className="instagram-item" key={post.id}>
              <a href={post.link} target="_blank" rel="noopener noreferrer">
                <img src={post.image} alt={`Instagram post ${post.id}`} />
              </a>
            </div>
          ))}
        </div>
      </div>
    </main>
  );
};

export default News;
